import React from 'react';

function DirectIPNotAllowed() {
  return (
    <div>
      <header>
        <h1>Error 1003</h1>
        <h2>Direct IP access not allowed</h2>
      </header>
      <section>
        <div>
          <h3>What happened?</h3>
          <p>You've requested an IP address that is part of the rachakondadharmendra.info network. A valid Host header must be supplied to reach the desired website.</p>
        </div>
        <div>
          <h3>What can I do?</h3>
          <p>If you are interested in learning more, please visit the official website <a href="https://rachakondadharmendra.info">rachakondadharmendra.info</a>.</p>
        </div>
      </section>
      <footer>
        <p>Performance & security by rachakondadharmendra.info</p>
      </footer>
    </div>
  );
}

export default DirectIPNotAllowed;
